package br.com.prime.fiscon.mobile.pojo;

public class UFPojo {
	private String id;
	private String uf;
	public String getUf() {
		return uf;
	}
	public void setUf(String uf) {
		this.uf = uf;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public UFPojo(String id, String uf) {
		super();
		this.id = id;
		this.uf = uf;
	}
	
	public String toString() {
		// TODO Auto-generated method stub
		return getUf();
	}
	

}
